import React from 'react';

import './Shop.css';

import Header from '../header/Header';

function Shop() {
  return (
    <>
      <Header />

      <div className='shop__main'>
        <div>
          <img src='../../images/car.png' alt='' />
          <p>Laptop</p>
          <p>$500</p>
          <p>Views</p>
        </div>
      </div>
    </>
  );
}

export default Shop;
